import React from "react";
import logo, { ReactComponent } from "./logo.svg";
import "./App.css";

class header extends Component {}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>こんにちは世界！</p>
          Learn React NOW!
        </header>
      </div>
    );
  }
}

export default App;
